import React from 'react';

const emojiList = [
    'üòÄ', 'üòÇ', 'üòç', 'üòé', 'ü§î', 'üò¢', 'üò°', 'ü•≥', 'ü§ñ', 'üëª'
];

const EmojiPalette: React.FC<{ onSelect: (emoji: string) => void }> = ({ onSelect }) => {
    return (
        <div className="emoji-palette">
            {emojiList.map((emoji) => (
                <span 
                    key={emoji} 
                    className="emoji" 
                    onClick={() => onSelect(emoji)}
                    role="button"
                    aria-label={`Select ${emoji}`}
                >
                    {emoji}
                </span>
            ))}
        </div>
    );
};

export default EmojiPalette;
